        return(
            <div>
                <div className="navbar">
                    <div className="gameTitle">Welcome To Set!!</div>
                    <div className="homePageTitle">Set Card Game </div>
                    <div className="homePageButtons">
                    <Link className="modeButton" exact="true" to={"/GamePage"}>Play</Link>
                    <Link className="modeButton"exact="true" to={"/RulePage"}>Rule</Link>
                </div>
                </div>

            </div>
        )
    }
}
